interface iProjectInfoProps {
    projectVideo:string,
}
function CardPopUpVideo(): JSX.Element {
    return (
        <div>
            <video controls width={1280} height={720}>
                <source src={props.projectVideo}/>
            </video>
        </div>
    )
}

